        <div className={styles.container}>
            <div className={styles.list_item}>
                <div className={styles.item_cont}>
                    <img src={img} alt="" />
                    <div className={styles.item_disc}>
                        <div className={styles.item_disc_1}>Сырный цыпленок</div>
                        <div className={styles.item_disc_2}>тонкое тесто 26см</div>
                    </div>
                    
                    </div>
                <div>2</div>
                <div>770</div>
                <div>x</div>
            </div>
            
        </div>
    );
};

export default CartList;
